import React from "react";
import AboutMe from "../Img/about.jpg";
import "./About.css";
const About = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col bg-danger">
          <div className="row">
            <div className="col-6 bg-dark">
              <p>Age</p> 30
              <p>Residence</p> Arg
              <p>E-mail</p> SH_Ricardo@hotmail.com
              <p>Phone</p> 1132716458
            </div>
          </div>
        </div>
        <div className="col-4 bg-info p-2 fs-6 text">
          <img className="img-fluid  img-thumbnail" src={AboutMe} />
          <div className="row">
            <div className="col">
              Soy una persona que encontro su verdadera pacion
              <br />
              Me emociona aprender y estoy en contante copacitacion
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default About;
